using System;
using System.Collections.Generic;
using System.Linq;

namespace AoC.Year2018.Day5
{
    public class Part2 : BasePart
    {
        private static string[] pairs;
        private static string[] forwardPairs;
        public Part2()
        {
            forwardPairs = pairs = Enumerable.Range(0, 26).Select(i => ((char)((int)'a' + i)).ToString() + ((char)((int)'A' + i)).ToString()).ToArray();
            pairs = pairs.Concat(pairs.Select(i => new string(i.Reverse().ToArray()))).ToArray();
        }

        protected void RunScenario(string title, string input)
        {
            RunScenario(title, () =>
            {
                var lines = input.Split(new[] { '\r', '\n' }, StringSplitOptions.RemoveEmptyEntries);
                var line = lines[0];

                var result = new Dictionary<string, int>();

                foreach (var remove in forwardPairs)
                {
                    var x = line.Replace(remove[0].ToString(), "").Replace(remove[1].ToString(), "");
                    result.Add(remove, React(x).Length);
                }

                var last = result.OrderBy(i => i.Value).First();

                Console.WriteLine(last);
            });
        }

        private static string React(string line)
        {
            while (true)
            {
                foreach (var pair in pairs)
                {
                    var newLine = line.Replace(pair, "");
                    if (line != newLine)
                    {
                        line = newLine;
                        goto loop;
                    }
                }

                break;
                loop:
                continue;
            }

            return line;
        }

        public override void Run()
        {
            RunScenario("initial", @"dabAcCaCBAcCcaDA");
            //return;
            RunScenario("part1", @"");

        }
    }
}
